__NUXT_JSONP__("/drugs/Letetresgene_Autoleucel", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"Human autologous T-lymphocytes transduced with a lentiviral vector encoding a T-cell receptor (TCR) specific for the cancer-testis antigens (CTAs) NY-ESO-1 and L antigen family member 1 (LAGE-1; Cancer\u002FTestis Antigen 2; CTAG2; CT2), with potential antineoplastic activity. Following leukapheresis, isolation of lymphocytes, expansion ex vivo, transduction, and reintroduction into the patient, letetresgene autoleucel specifically target and bind to NY-ESO-1\u002FLAGE-1-overexpressing tumor cells. This may result in a cytotoxic T-lymphocyte (CTL)-mediated elimination of NY-ESO-1\u002FLAGE-1-positive cancer cells. NY-ESO-1 and LAGE-1, members of the cancer-testis antigen (CTA) family, are overexpressed on the surface of various tumor cell types.",fdaUniiCode:"B5ME4ZU4BS",identifier:"C121379",preferredName:c,semanticType:"Cell",subclassOf:["C129826","C138180","C1962","C28681"],synonyms:["Autologous Anti-NY-ESO-1\u002FLAGE-1 TCR-transduced c259 T Lymphocytes GSK3377794","Autologous T-Cells Expressing Enhanced TCRs Specific for NY-ESO-1\u002FLAGE-1a GSK3377794","Genetically Engineered NY-ESO-1 Specific [c259] T Cells GSK3377794","Genetically Engineered NY-ESO-1\u002FLAGE-1 Specific (c259) T Cells GSK3377794","LETETRESGENE AUTOLEUCEL",c,"NY-ESO-1c259 T Cells GSK3377794"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FLetetresgene_Autoleucel",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Letetresgene_Autoleucel","Letetresgene Autoleucel","2021-10-30T13:20:08.993Z")));